import VueRouter from "vue-router"
import Main from "@/components/Main.vue";
import Vue from "vue";

Vue.use(VueRouter)
export default new VueRouter({
    routes:[
        {
            path
        },
        {
            path: "/",
            name:"main",
            component: Main
        },
        {
            path:"/charts",
            name:"charts",
            component:()=>import("@/components/Charts.vue")
        },
        {
            path:"/instruction",
            name:"instruction",
            component: ()=>import("@/components/Instruction.vue")
        }
    ]
})
